import React, { useContext } from "react";

export default function CustomInput(props) {
    const { classes, type, onChange, placeholder, label, ref } = props;
    return (
        <>
            <label>{label}</label>
            <input
                className={classes}
                type={type}
                onChange={onChange}
                placeholder={placeholder}
                ref={ref}
            />
        </>
    )
}
